import React, {useState, useEffect} from "react";
import {Link, useHistory} from 'react-router-dom';
import { useDispatch, useSelector } from "react-redux";
import { postCliente, getObrasSociales } from "../redux/actions";

export default function ClientCreate(){
  const dispatch = useDispatch();
  const history = useHistory();
  const obrasSociales = useSelector((state) => state.obrasSociales);

  const [input, setInput] = useState({
    nombre: '',
    apellido: '',
    puntos: 0,
    dni: '',
    numeroDeAfiliado: 0,
    direccion: '',
    telefono: '',
    obraSocial: []
  });

  function handleChange(e){
    setInput({
      ...input,
      [e.target.name] : e.target.value
    })
    console.log(input);
  };

  function handleSelect(e){
    setInput({
      ...input,
      obrasSocial: [...input.obraSocial, e.target.value]
    })
  };

  function handleSubmit(e){
    e.preventDefault();
    console.log(input);
    dispatch(postCliente(input));
    alert('cliente creado con Ã©xito!');
    setInput({
      nombre: '',
      apellido: '',
      puntos: 0,
      dni: '',
      numeroDeAfiliado: 0,
      direccion: '',
      telefono: '',
      obraSocial: []
    })
  }

  useEffect(()=>{
    dispatch(getObrasSociales());
  }, [dispatch]);

  return(
    <div>
      <Link to={'/home'}><button>volver</button></Link>
      <h1>Agregar Nuevo Cliente</h1>
      <form>
        <div>
          <label>Nombre: </label>
          <input type="text" value={input.nombre} name='nombre' onChange={handleChange}/>
        </div>
        <div>
          <label>Apellido: </label>
          <input type="text" value={input.apellido} name='apellido' onChange={handleChange}/>
        </div>
        <div>
          <label>Puntos: </label>
          <input type="number" value={input.puntos} name='puntos' onChange={handleChange}/>
        </div>
        <div>
          <label>D.N.I: </label>
          <input type="text" value={input.dni} name='dni' onChange={handleChange}/>
        </div>
        <div>
          <label>NÃºmero de Afiliado: </label>
          <input type="number" value={input.numeroDeAfiliado} name='numeroDeAfiliado' onChange={handleChange}/>
        </div>
        <div>
          <label>DirecciÃ³n: </label>
          <input type="text" value={input.direccion} name='direccion' onChange={handleChange}/>
        </div>
        <div>
          <label>TelÃ©fono: </label>
          <input type="text" value={input.telefono} name='telefono' onChange={handleChange}/>
        </div>
        <div>
          <label>Obras Sociales: </label>
          <select onChange={(e) => handleSelect(e)}>
            {obrasSociales.map((os) =>(
              <option value={os.nombre}>{os.nombre.toUpperCase()}</option>
            ))}
          </select>
        </div>
        <ul><li key={input.nombre}>{input.obraSocial.map(el => el + " ,")}</li></ul>

        <button type="submit">agregar cliente</button>

      </form>
    </div>
  )
}
